import Link from "next/link";

export default function Navbar () {
  const styles = {
    display: "flex",
    background: "grey",
    alignItem:"space-between"
  };
  return (
    <div style= {styles}>
      <Link href="/about"> 
        <a>About Page</a>
      </Link>
      <Link href="/contact">
        <a>Contact Page</a>
      </Link>
    </div>
  )
}
